import { Link } from "../Link";
import "./index.css";

function ActivitySection({ link, linkText, shortDescription }) {
  return (
    <section className="activity">
      <Link href={link}>
        <span className="activity__link-text">{linkText}</span>
      </Link>
      <p className="activity__short-description">{shortDescription}</p>
    </section>
  );
}

export function Activities() {
  const lineateWebSiteLink = "https://lineate.ru/";
  const githubLink = "https://github.com/parabolabam";
  const twitterLInk = "https://twitter.com/parabolabam";
  return (
    <>
      <ActivitySection
        link={lineateWebSiteLink}
        linkText="Lineate Team Member"
        shortDescription="Occupied software engineer position"
      />
      <section className="activity">
        <Link href={lineateWebSiteLink}>
          <span className="activity__link-text">Lineate Team Member</span>
        </Link>
        <p className="activity__short-description">
          Occupied software engineer position
        </p>
      </section>

      <section className="activity">
        <Link href={githubLink}>
          <span className="activity__link-text">Github</span>
        </Link>
        <p className="activity__short-description">
          Yet there is no projects I've created but code examples might be found
          here
        </p>
      </section>

      <section className="activity__social">
        <Link href={twitterLInk}>
          <span class="activity__link-text">Twitter</span>
        </Link>
        <p className="activity__short-description">
          Share my thoughts and experience mostly here
        </p>
      </section>
    </>
  );
}
